  ReadableStreamClose(stream);

  const reader = stream._reader;
  if (reader !== undefined && IsReadableStreamBYOBReader(reader)) {
    reader._readIntoRequests.forEach(readIntoRequest => {
      readIntoRequest._closeSteps(undefined);
